import React from 'react';
import footerDevKg from "../../Assets/img/devKg logo.svg"

const Footer = () => {
	return (
		<div id='footer'>
				<div className="footer">
			<div className="container">
					<img  className='footer' src={footerDevKg} alt="img" />
				</div>
			</div>
		</div>
	);
};

export default Footer;
